import React from "react";
import Calendar from 'react-calendar'
import './Page.css'
function Event()
{
    return(
        <div>
        <h1>Its event page</h1>
        <div id='calendar'>
        <Calendar id='calendar'/>
        </div>
        <div></div>
        </div>
    )
}

export default Event;
